import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Sidebar from './components/Sidebar';
import Dashboard from './components/Dashboard';
import QuantityData from './components/QuantityData';
import RainRateData from './components/RainRateData';
import SizeData from './components/SizeData';
import MeltingPointData from './components/MeltingPointData';
import FreezingPointData from './components/FreezingPointData';
import WeightGramsData from './components/WeightGramsData';
import LocationData from './components/LocationData';
import TemperatureData from './components/TemperatureData';
import ColorData from './components/ColorData';
import PressureData from './components/PressureData';

function App() {
  return (
    <Router>
      <Sidebar />
      <Switch>
        <Route path="/dashboard" component={Dashboard} />
        <Route path="/temperature" component={TemperatureData} />
        <Route path="/pressure" component={PressureData} />
        <Route path="/color" component={ColorData} />
        <Route path="/color" component={QuantityData} />
        <Route path="/color" component={RainRateData} />
        <Route path="/color" component={SizeData} />
        <Route path="/color" component={MeltingPointData} />
        <Route path="/color" component={FreezingPointData} />
        <Route path="/color" component={WeightGramsData} />
        <Route path="/color" component={LocationData} />
      </Switch>
    </Router>
  );
}

export default App;
